import chess

def simplify_fen_string(fen):
    parts = fen.split(' ')
    simplified_fen = ' '.join(parts[:4])  # Zachov√°v√°me pouze informace o pozici
    return simplified_fen

def evaluate_position(board):
    if board.is_checkmate():
        return -1000  # Mat protihr√°ƒçi
    elif board.is_stalemate() or board.is_insufficient_material() or board.can_claim_draw():
        return 0  # Rem√≠za
    else:
        return None  # Hra pokraƒçuje

def update_AR_for_mate_in_k(board, AR, max_k=1000):
    k = 0
    while True:
        k += 1
        changed = False
        for _ in range(2):  # Dvakr√°t pro ka≈ædou hodnotu k
            for fen in list(AR.keys()):
                board.set_fen(fen)
                if AR[fen] is not None:
                    continue  # Tato pozice ji≈æ byla ohodnocena

                evaluations = []
                for move in board.legal_moves:
                    board.push(move)
                    next_fen = simplify_fen_string(board.fen())
                    if next_fen not in AR:
                        AR[next_fen] = evaluate_position(board)  # P≈ôid√°n√≠ nov√Ωch pozic do AR
                    board.pop()

                    if AR[next_fen] is not None:
                        evaluations.append(AR[next_fen])

                # V√Ωpoƒçet nov√©ho hodnocen√≠ na z√°kladƒõ n√°sledovn√≠k≈Ø
                if evaluations:
                    max_eval = -min(evaluations)
                    if max_eval == -1001+k:
                        AR[fen] = 1000 - k
                        changed = True
                    elif 0 in evaluations:
                        AR[fen] = 0
                        changed = True

            if not changed:
                break  # Konec cyklu, pokud nedo≈°lo k ≈æ√°dn√© zmƒõnƒõ

        if k >= max_k or not changed:
            break  # Konec hlavn√≠ho cyklu, pokud dos√°hneme max_k nebo nedo≈°lo k ≈æ√°dn√© zmƒõnƒõ

            
def print_draw_positions(AR):
    """
    Vytiskne v≈°echny rem√≠zov√© pozice (hodnota 0) zaznamenan√© v slovn√≠ku AR.
    """
    print("Rem√≠zov√© pozice:")
    for fen, value in AR.items():
        if value != None and value < -980 and value > -1010:
            print(f"FEN>: {fen}, Hodnota: {value}","\n",chess.Board(fen),"<\n")
            
            
def main():
    initial_fen = "8/8/8/8/3Q4/5K2/8/4k3 w - - 0 1"
    board = chess.Board(initial_fen)
    AR = {simplify_fen_string(initial_fen): None}  # Inicializace AR s poƒç√°teƒçn√≠ pozic√≠
    
    update_AR_for_mate_in_k(board, AR, max_k=50)  # Aktualizace AR
    print_draw_positions(AR)
    
    

